<?php
ini_set('display_errors', 0);
ini_set('display_startup_errors', 0);
ini_set('log_errors', 1);
ini_set('error_log', 'errors.log');
error_reporting(E_ALL);
date_default_timezone_set('Asia/Jakarta');

require_once __DIR__ . "/modules/getcontact.php";
require_once __DIR__ . "/config.php";

try {
  switch ($_SERVER["REQUEST_METHOD"]) {
    case "POST":

      #region Initialize errors, old_values array

      $errors = [];
      $old_values = [];
      $old_values["phone_number"] = trim(htmlspecialchars($_POST["phone_number"]));

      #endregion

      #region Parse form data

      $timestamp = date_create()->format('Uv');
      $phone_number = trim(htmlspecialchars($_POST['phone_number']));
      $final_key = trim(htmlspecialchars($_POST['final_key']));
      $token = trim(htmlspecialchars($_POST['token']));
      $source_type = trim(htmlspecialchars(strtolower($_POST['source_type'])));

      #endregion

      #region Validate phone number

      if (strpos($phone_number, "0") === 0) {
        $phone_number = "+62" . substr($phone_number, 1);
      } else if (strpos($phone_number, "62") === 0) {
        $phone_number = "+" . $phone_number;
      } else if (strpos($phone_number, "-") !== false || strpos($phone_number, " ") !== false) {
        $phone_number = str_replace(["-", " "], "", $phone_number);
      } else {
        $alert["type"] = "warning";
        $alert["message"] = "Form data is invalid";
        $errors["phone_number"] = "Phone number is invalid";
        break;
      }

      #endregion

      #region Validate final key

      if ($final_key == null || $final_key == "") {
        $alert["type"] = "warning";
        $alert["message"] = "Form data is invalid";
        $errors["final_key"] = "Final key is invalid";
        break;
      }

      #endregion

      #region Validate token

      if ($token == null || $token == "") {
        $alert["type"] = "warning";
        $alert["message"] = "Form data is invalid";
        $errors["token"] = "Token is invalid";
        break;
      }

      #endregion

      #region Validate source type

      if (!isset($source_type) || empty($source_type || is_null($source_type))) {
        $alert["type"] = "warning";
        $alert["message"] = "Form data is invalid";
        $errors["source_type"] = "Source type is invalid";
        break;
      }

      /**
       * source = profile --> endpoint = number-detail
       * source = search --> endpoint = search
       */
      $source_endpoint = "";
      if ($source_type == "search") {
        $source_endpoint = GTC_API_EP_SEARCH;
      } elseif ($source_type == "profile") {
        $source_endpoint = GTC_API_EP_NUMBER_DETAIL;
      } else {
        $alert["type"] = "warning";
        $alert["message"] = "Form data is invalid";
        $errors["source_type"] = "Source type is invalid (2)";
        break;
      }

      #endregion

      #region Prepare for cURL

      $key = GTC_HMAC_SECRET_KEY;

      $data = json_encode([
        "countryCode" => "us",
        "phoneNumber" => $phone_number,
        "source" => $source_type, // profile | search
        "token" => $token,
      ]);

      $curl = curl_init();

      curl_setopt_array($curl, [
        CURLOPT_URL => GTC_API_BASE_URL . $source_endpoint,
        CURLOPT_RETURNTRANSFER => true,
        CURLOPT_ENCODING => '',
        CURLOPT_MAXREDIRS => 10,
        CURLOPT_TIMEOUT => 20,
        CURLOPT_CONNECTTIMEOUT => 10,
        CURLOPT_FOLLOWLOCATION => true,
        CURLOPT_HTTP_VERSION => CURL_HTTP_VERSION_1_1,
        CURLOPT_CUSTOMREQUEST => "POST",
        CURLOPT_POSTFIELDS => "{\"data\": \"" . getcontact_encrypt($data, $final_key) . "\"}",
        CURLOPT_HTTPHEADER => [
          "X-Os: android 9",
          "X-Mobile-Service: GMS",
          "X-App-Version: 5.6.2",
          "X-Client-Device-Id: 063579f5e0654a4e",
          "X-Lang: en_US",
          "X-Token: $token",
          "X-Req-Timestamp: $timestamp",
          "X-Encrypted: 1",
          "X-Network-Country: us",
          "X-Country-Code: us",
          "X-Req-Signature: " . getcontact_signature($timestamp, $data, $key),
          "Content-Type: application/json",
        ],
      ]);

      #endregion

      #region Execute

      $response = curl_exec($curl);

      curl_close($curl);

      $decoded_response = json_decode($response, false);

      $response = json_decode(getcontact_decrypt($decoded_response->data, $final_key), true);

      #endregion

      #region Validate http status code

      if (!isset($response["meta"]["httpStatusCode"])) {
        $alert["type"] = "danger";
        $alert["message"] = "Invalid http response";
        break;
      }

      if ($response["meta"]["httpStatusCode"] !== 200) {
        $alert["type"] = "danger";
        $alert["message"] = "Invalid http status code: " . $response["meta"]["httpStatusCode"];
        break;
      }

      #endregion

      #region Validate response

      if ($response == null) {
        $alert["type"] = "warning";
        $alert["message"] = "Invalid response";
        break;
      }

      $alert["type"] = "success";
      $alert["message"] = "Success";
      $result = $response;

      $censored_phone_number = censor_phone_number($phone_number);

      $censored_phone_number = preg_replace("/[^0-9x]/", "", $censored_phone_number);

      $old_values = null;

      #endregion

      break;
    case "GET":
      break;
    default:
      $alert["type"] = "danger";
      $alert["message"] = "Invalid request method";
      break;
  }
} catch (\Exception $ex) {
  error_log($ex->getMessage());
  $alert["type"] = "danger";
  $alert["message"] = "Internal server error";
}
